import React from "react";

const Table = ({ titles }) => {
    return (
        titles.map((elt, index) => {
            return (
                <div key={index}>
                    <h1>{elt.title}</h1>
                    {elt.fields.map((fieldElt, fieldIndex) => {
                        return (
                            <div key={fieldIndex}>
                                <input placeholder={elt.title}/>
                                <br />
                            </div>
                        )
                    })}
                </div>
            )
        })
    )
}

export default Table;
